export const enum TIMES_TYPE {
  DEFAULT = 1
}
export enum CROWD_TYPE {
  DEFAULT = 1,
  CUSTOM = 2
}
export enum SHARE_TYPE {
  DEFAULT = 1,
  CUSTOM = 2
}
export enum STOP_SWIPER {
  DEFAULT = 1
}
export enum ACTIVITY_STATUS {
  DISABLED = 1,
  ISHOLDING = 2,
  ISSTOPED = 3
}
export enum NOT_PRIZE_IMG_TYPE {
  DEFAULT = 1,
  CUSTOM = 2
}
export enum IMG_TYPE {
  DEFAULT = 1,
  CUSTOM = 2
}
export enum SHOP_TYPE {
  DEFAULT = 1,
  CUSTOM = 2
}
export enum PRIZE_TYPE {
  DEFAULT = 1,
  CUSTOM = 2,
  POINTS = 4
}
export enum CONDITION_TYPE {
  FREE = 1,
  POINTS = 2
}
